        if (nutrition.energikcal === "" || nutrition.energikcal < 0) {
          console.log("energikcal ===", selectsPart, nutrition.energikcal);
          setEnergikcal(true);
          setShowResults(false);
          setShowEmptyResult(true);
        } else {
          setEnergikcal(false);
        }
